import React from 'react'

function PaginationComponent() {
  return (
    <div>
    <div className="-first">
                <button
                    disabled={!canPrevious}
                    onClick={() => {
                        if (!canPrevious) return
                        this.changePage(0)
                    }}
                > First </button>
            </div>
            <div className="-last">
                <button
                    onClick={() => {
                        if (!canNext) return
                        this.changePage(pages)
                    }}
                    disabled={!canNext}
                > Last </button>
            </div>
      
    </div>
  )
}

export default PaginationComponent;
